async function readJson(){let t=await fetch("./data/products.min.json"),i=await t.json(),s=document.getElementById("checkoutList");listArticles(i,0,s,"id1"),listArticles(i,1,s,"id2"),listArticles(i,2,s,"id3"),listArticles(i,3,s,"id4"),listArticles(i,4,s,"id5"),listArticles(i,5,s,"id6"),listArticles(i,6,s,"id7"),listArticles(i,7,s,"id8"),listArticles(i,8,s,"id9"),listArticles(i,9,s,"id10")}function listArticles(t,i,s,e){if(null==localStorage.getItem(e))return;let l=document.createElement("p");l.classList.add("mt-0","mb-0","ms-2");let c=t.products[i].title;l.innerHTML=c+"......."+localStorage.getItem(e),s.appendChild(l)}readJson();